import './Main.scss';

// props--
// title
// channel
// timestamp
// views
// likes
// description


function Main(props) {
  return (
    <section>
      <h1>
        {props.title}
      </h1>
      <article>
        <div>
          <h3>
            {props.channel}
          </h3>
          <h4>
            {props.timestamp}
          </h4>
        </div>
        <div>
          <h4>
            {props.views}
          </h4>
          <h4>
            {props.likes}
          </h4>
        </div>
      </article>
      <article>
          {props.description}
      </article>
    </section>
  )
}

export default Main;
